import { createGlobalStyle } from "styled-components";

import source from "./source.woff";
import source2 from "./source.woff2";
import quicksand from "./quicksand.woff";
import quicksand2 from "./quicksand.woff2";
import calibrebold from "./calibreBold.woff";
import calibrebold2 from "./calibreBold.woff2";

export default createGlobalStyle`
    @font-face {
        font-family: 'source';
        src: local('source'), local('source2'),
        url(${source2}) format('woff2'),
        url(${source}) format('woff');
        font-weight: 300;
        font-style: normal;
    }
    @font-face {
        font-family: 'quicksand';
        src: local('quicksand'), local('quicksand2'),
        url(${quicksand2}) format('woff2'),
        url(${quicksand}) format('woff');
        font-weight: 100;
        font-style: normal;
    }
     @font-face {
         font-family: 'calibrebold';
         src: local('calibrebold'), local('calibrebold2'),
        url(${calibrebold2}) format('woff2'),
        url(${calibrebold}) format('woff');
        font-weight: 100;
        font-style: normal;
    }
`;
